import React from 'react';
const Login = () => {
    return ( 
        <div class="container">
            <div class="row">
                <div class="col-6 pt-5 mx-auto">
                    <h3>Login</h3>
                    <div class="row">
                        <div class="col-12">
                            <label>Email :</label>
                            <input type="text" name="email" class="form-control"/>
                        </div>
                        <div class="col-12">
                            <input type="password" name="password" class="form-control"/>
                        </div>
                    </div>
                </div>
            </div>
        </div>
     );
}

export default Login;
